import React from 'react';

const Section = ({children, title, url}) => {

  return (
    <a href={url}>
      <section className='section'> 
        {title ? (
          <div className='section-header'>
            <h2 className='section-title'>{title}</h2>
          </div>
        ) : null}
        {children}
      </section>
    </a>
  );
};

export default Section;
